import React from 'react';

import UsersList from '../components/UsersList';

const Users = () => {
  const USERS = [
    {
      id: "u1",
      name: "Tony James",
      image: '../../../goku_ssj_chibi.png',
      places: 3,
    },
  ];

  return <UsersList items={USERS} />;
};

export default Users;
